import React from 'react'
import {
    Container,
    Form,
    FormControl,
    Nav,
    Navbar,
    NavDropdown,
  } from "react-bootstrap";
function Footer() {
  return (
    <Navbar fixed="bottom" style={{
        width: "100%",
        position: "relative",
        bottom: 0,
        display: "flex",
        justifyContent: "center",
      }}>
    <Container>
      <Navbar.Text>
        &copy; 2024 Amani Alkalbani
      </Navbar.Text>
    </Container>
  </Navbar>
  )
}

export default Footer
